import React from "react";
import classes from "./Container.module.css";

import Item from "./listComponents/Item";
import Form from "./formComponents/Form";

const Container = () => {
  const tmpObj = {
    name: "Test",
    date: "TestDate",
  };

  return (
    <div className={classes.container}>
      {/* <Item obj={tmpObj} /> */}
      <Form />
    </div>
  );
};

export default Container;
